import React from 'react';
import {Row,Col,Container,Button,ButtonGroup} from 'react-bootstrap';
import { Route, Switch } from 'react-router-dom';
import AddNewVeggies from '../components/Admin/AddNewVeggies';
import Orderlist from '../components/Admin/Orderlist';
import Userlist from '../components/Admin/Userlist';
import Veggieslist from '../components/Admin/Veggieslist';

const AdminScreen = () => {
  return (
   < >
   <Container>
   <Row>
<h1 className='text-center bg-dark text-light p-2'>Admin Panel</h1>
<Col md={4}>
<ButtonGroup vertical style={{minHeight : "500px"}}>
  <Button>All Users</Button>
  <Button>All Vegetables</Button>
  <Button>All New Vegetables</Button>
  <Button>All Orders</Button>

  
</ButtonGroup>
</Col>
<Col md={8}>
    <Switch>
        <Route path="/admin/userlist" component={Userlist} exact />
        <Route path="/admin/veggieslist" component={Veggieslist} exact />
        <Route path="/admin/addnewveggies" component={AddNewVeggies} exact />
        <Route path="/admin/orderlist" component={Orderlist} exact />
    </Switch>
</Col>

   </Row>
   </Container>
   </>
  )
}

export default AdminScreen
